import React, { useState } from 'react';
import './index.css';

function App() {
  const [accounts, setAccounts] = useState([
    { id: 'checking', name: 'Checking Account', balance: 1000 },
    { id: 'savings', name: 'Savings Account', balance: 5000 }
  ]);

  return (
    <div className="container">
      <div className="header">
        <h1>Finance Tracker</h1>
        <button className="danger">Reset</button>
      </div>

      <div className="card">
        <h2>Accounts</h2>
        {accounts.map(account => (
          <div key={account.id}>
            <h3>{account.name}</h3>
            <p>${account.balance}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
